			</p>
			<div class="btns">

				</div>
				<br />
				<div
					onclick="location.href=__uv$config.prefix+xor.encode('https://github.com/caracal-js')"

				</div>
				<div
					onclick="location.href=__uv$config.prefix+xor.encode('https://luphoria.com')"
					class="crm"
				>
					<img class="icn" id="lu" src="/contrib/luphoria.png" />
					<a class="btn">luphoria</a>
				</div>
        <div
        onclick="location.href=__uv$config.prefix+xor.encode('https://github.com/amethystnetwork-dev')"

        <img class="icn" id="lu" src="/contrib/amethystnetwork-dev.png" />
